import { VideosBody } from '../Helper/VideosBody';

import styles from './Videos.module.css'

const Videos = () => {
    console.log(VideosBody)
    return (
        <div className={styles.videoCont}>

            {VideosBody.map(vids => {
                return (<video className={styles.vid} key={vids.id} alt={vids.name} src={vids.src} type='video/mp4'>

                    </video>)
            })}

        </div>
    )
};

export default Videos;
